import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Collapse from '@material-ui/core/Collapse';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import DraftsIcon from '@material-ui/icons/Drafts';
import SendIcon from '@material-ui/icons/Send';
import ExpandLess from '@material-ui/icons/ExpandLess';
import ExpandMore from '@material-ui/icons/ExpandMore';
import Checkbox from '@material-ui/core/Checkbox';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import TextField from '@material-ui/core/TextField';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

function App() {

  const [shit, setShit] = useState("I am shit");

  const [openRecent, setOpenRecent] = React.useState(false);
  const recent_view_list = [{name:"a"}, {name:"b"}, {name:"c"}, {name:"d"}];
  const handleOpenRecent = () => {setOpenRecent(!openRecent);};

  const [openFavourites, setOpenFavourites] = React.useState(false);
  const favourites_list = [{name:"AAPL"}, {name:"NVDA"}, {name:"ORCL"}];
  const handleOpenFavourites = () => {setOpenFavourites(!openFavourites);};

  const [openIndustry, setOpenIndustry] = React.useState(false);
  const handleOpenIndustry = () => {setOpenIndustry(!openIndustry);};

  const [checkPublishing, setCheckPublishing] = React.useState(false);
  const handleCheckPublishing = () => {setCheckPublishing(!checkPublishing);};

  const [checkEntertainment, setCheckEntertainment] = React.useState(false);
  const handleCheckEntertainment = () => {setCheckEntertainment(!checkEntertainment);};


  const sampleListOfStock = [
    {
      symbol: "AAPL",
      company: "Apple",
      Price: "5.0",
      ListOfHistoryPrice:[
        {price: "1.0"},
        {price: "1.2"},
        {price: "1.4"},
        {price: "1.6"},
        {price: "1.8"}
      ]
    },
    {
      symbol: "GGGGG",
      company: "Apple",
      Price: "5.0",
      ListOfHistoryPrice:[
        {price: "1.0"},
        {price: "1.2"},
        {price: "1.4"},
        {price: "1.6"},
        {price: "1.8"}
      ]
    },
    {
      symbol: "BBBBB",
      company: "Apple",
      Price: "5.0",
      ListOfHistoryPrice:[
        {price: "1.0"},
        {price: "1.2"},
        {price: "1.4"},
        {price: "1.6"},
        {price: "1.8"}
      ]
    }
  ]
  const [listOfStock, setListOfStock] = React.useState(sampleListOfStock);
  const handleListOfStock = () => {setListOfStock(listOfStock);};


  const sampleLikeStock = [
    {
      symbol: "FUCK",
      Price: "5.0"
    },
    {
      symbol: "GGGGG",
      Price: "5.0"
    },
    {
      symbol: "BBBBB",
      Price: "5.0"
    }
  ]
  const [likeStock, setLikeStock] = React.useState(sampleLikeStock);
  const handleLikeStock = () => {setLikeStock(likeStock);};


  // var shit_data = () => {
  //   console.log("Someone wants bigger shit")
  //   fetch('http://localhost:4000/shit').then(resp => resp.json()).then(resp => setShit(resp.message)).catch(err => console.log(err))
  // }
  //
  // <Grid item xs={3}>
  // <Paper>
  //     <Button id="shitbutton" variant="contained" color="primary" onClick={shit_data}> Click me to get a big shit </Button>
  //     <a
  //       className="App-link"
  //       href="https://reactjs.org"
  //       target="_blank"
  //       rel="noopener noreferrer"
  //     >
  //       {shit}
  //     </a>
  // </Paper>
  // </Grid>


  const useStyles = makeStyles((theme) => ({

    paper: {
      padding: theme.spacing(5),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
    root: {
      width: '100%',
      maxWidth: 500,
      backgroundColor: theme.palette.background.paper,
    },
    gridroot: {
      flexGrow: 1,
      marginLeft: '50rem'
    },
    griditem:{
      margin: 20
    },
    paperColumn: {
      height:"100%"
    },
    nested: {
      paddingLeft: theme.spacing(4),
    },
    bottomblock: {
      padding: "10px"
    }
  }));

  const classes = useStyles();

  return (
      <div className="App">

      <Grid container spacing={3}>


        <Grid item className={classes.griditem} xs={8}>
        <TextField fullWidth style={{ margin: 8 }} id="search" label="Search" variant="outlined" />
        </Grid>

        <Grid item className={classes.griditem} xs={2}>
        <TextField fullWidth style={{ margin: 8 }} id="username" label="Username" variant="outlined" />
        </Grid>

        <Grid item className={classes.griditem} xs={2}>
        <TextField fullWidth style={{ margin: 8 }} id="password" label="Password" variant="outlined" />
        </Grid>



        <Grid item className={classes.griditem} xs={2}>
        <Paper >
          <List
             component="nav"
             aria-labelledby="nested-list-subheader"
             className={classes.root}
           >
             <ListItem button onClick={handleOpenRecent}>
               <ListItemText primary="Recent View" />
               {openRecent ? <ExpandLess /> : <ExpandMore />}
             </ListItem>
             <Collapse in={openRecent} timeout="auto" unmountOnExit>
               <List component="div" disablePadding>
                 {recent_view_list.map(item => {
                   return (
                     <ListItem button className={classes.nested}>
                       <ListItemText primary={item.name} />
                     </ListItem>
                   )
                 })}
               </List>
             </Collapse>
             <ListItem button onClick={handleOpenFavourites}>
               <ListItemText primary="Favourites" />
               {openFavourites ? <ExpandLess /> : <ExpandMore />}
             </ListItem>
             <Collapse in={openFavourites} timeout="auto" unmountOnExit>
               <List component="div" disablePadding>
                 {favourites_list.map(item => {
                   return (
                     <ListItem button className={classes.nested}>
                       <ListItemText primary={item.name} />
                     </ListItem>
                   )
                 })}
               </List>
             </Collapse>
           </List>
        </Paper>
        </Grid>

        <Grid item className={classes.griditem} xs={6}>
        <Paper >
          <List>
          {listOfStock.map(item => {
            return (
              <ListItem>
                {item.symbol + "(" + item.company + ")"}
                {"Today's price:" + item.Price}
                {item.ListOfHistoryPrice.map(historyItem => {
                  return (
                    <ListItem>
                      {historyItem.price}
                    </ListItem>
                  )
                })}
              </ListItem>
            )
          })}
          </List>
        </Paper>
        </Grid>


        <Grid item className={classes.griditem} xs={2}>
        <Paper >

           <List
              component="nav"
              aria-labelledby="nested-list-subheader"
              className={classes.root}
            >
              <ListItem button onClick={handleOpenIndustry}>
                <ListItemText primary="Industry" />
                {openIndustry ? <ExpandLess /> : <ExpandMore />}
              </ListItem>
              <Collapse in={openIndustry} timeout="auto" unmountOnExit>
                <List component="div" disablePadding>
                  <ListItem button className={classes.nested}>
                    <FormControlLabel
                      control={
                        <Checkbox
                          checked={checkPublishing}
                          onChange={handleCheckPublishing}
                          inputProps={{ 'aria-label': 'primary checkbox' }}
                        />
                      }
                      label="Publishing"
                    />
                  </ListItem>
                  <ListItem button className={classes.nested}>
                    <FormControlLabel
                      control={
                        <Checkbox
                          checked={checkEntertainment}
                          onChange={handleCheckEntertainment}
                          inputProps={{ 'aria-label': 'primary checkbox' }}
                        />
                      }
                      label="Entertainment"
                    />

                  </ListItem>
                </List>
              </Collapse>
            </List>

        </Paper>
        </Grid>
        <Grid item className={classes.griditem} xs={1}/>

        </Grid>

        <div className={classes.bottomblock}>
        <List>
          {likeStock.map(item => {
            return (
              <ListItem>
                {item.symbol}
                {item.Price}

              </ListItem>
            )
          })}
        </List>
        </div>






    </div>
  );
}

export default App;
